import reactImg from '../assets/game-logo.png';
export default function GameWinner({winner}){
 return(
    <>
     <div id="game-over">
            <h2>Game Over!</h2>
            <p>{winner} Won !!!</p>
            <p>
                <button>Rematch!!</button>
            </p>
        </div>
    </>
 );
}
